L-applikazzjoni tal-intitolament tas-saħħa f’Malta tista' tintuża miċ-ċittadin biex jinteraġixxi mal-Ministeru għas-Saħħa u l-Fornituri tal-Kura tas-Saħħa f’Malta għal diversi każijiet:
       •      Titlob, Iġġedded, Tikkanċella l-EHIC;
       •      Titlob, Tikkanċella l-RHA;
       •      Tiċċekkja l-Eliġibilità;
       •      Titlob għall-Informazzjoni.

L-applikazzjoni se tippermetti liċ-ċittadin jibgħat talbiet lill-Ministeru għas-Saħħa biex iżomm kont tal-progress u l-istat tat-talbiet, kif ukoll biex jinteraġixxi mal-ministeru permezz tat-trasferiment tal-formoli u annessi elettroniċi.

L-applikazzjoni se tinforma liċ-ċittadin fir-rigward ta' kwalunkwe aġġornament dwar it-talbiet miftuħa, permezz ta' email, SMS u notifiki ta 'l-applikazzjoni.

L-applikazzjoni tippermetti lill-klijent jibgħat annessi permezz ta 'sorsi differenti: sistema tal-fajl lokali, ‘cloud’, kamera u skaner tal-mowbajl.

Timelogger Plus is a time tracking app that allows you to actively manage and monitor various tasks on your iPhone, Apple Watch, iPad, and Mac securely and updated across all devices using iCloud. It is ideal for freelancing, repetitive daily routines, homemaking tasks, personal projects, or any activity people want to track and control.

Timelogger Plus lets you:
 ▪ Record time using stopwatches;
 ▪ Define Daily, Weekly, or Monthly Goals;
 ▪ Synchronize records between devices using iCloud;
 ▪ Generate PDF reports from custom intervals;
 ▪ Input time manually;
 ▪ Have multiple stopwatches active;
 ▪ Set Home Screen Widgets for ease to use;
 ▪ Set Lock Screen Widgets for ease to use;
 ▪ Use the Split View on the iPad for ease to use;
 ▪ Use the Stage Manager on the iPad for ease to use;
 ▪ Integrate with the Shortcuts application;
 ▪ Define hourly rates for your tasks;
 ▪ Define hourly rates for your folders;
 ▪ Export your entries to CSV;
 ▪ Create notes;
 ▪ Create billing notes;
 ▪ Use Context actions for ease to use;
 ▪ Add Tags to your Tasks, Entries, or Notes;
 ▪ Generate Manual backups;
 ▪ Archive Folders, Tasks, Entries, or Notes;
 ▪ Analyze your data through a Dashboard;
 ▪ Choose any Color for your Tasks and Folders;
 ▪ Filter by Folders or Tasks on the Dashboard views;
 ▪ Schedule notifications for running stopwatches;
 ▪ Change to Light or Dark mode;


